import { gql, graphql } from 'react-apollo'
import withData from 'C:/Users/sunilkumara.v.j/Desktop/NextjsSanity/apollo/apollo.js'


export const query = graphql`
{
  allSanityBeerProducts {
    edges {
      node {
        _id
        price
        title
        description
        image {
          asset {
            url
          }
        }
        slug {
          current
        }
      }
    }
  }
}
`

const Index = ({data}) => {
    return (
      <div>
        <p>Hello world!</p>
      </div>
    )
}
// const GraphqlIndex = graphql(query)(Index);

export default withData(Index);
